fn to_compact_encoded_point(&self) -> CtOption<EncodedPoint<C>> {
    let point = self.to_compact();

    let mut bytes = CompressedPoint::<C>::default();
    bytes[0] = sec1::Tag::Compact.into();
    bytes[1..].copy_from_slice(&point.x.to_repr());

