fn mul_assign(&mut self, rhs: Scalar) {
    *self = Scalar::mul(self, &rhs);
}

fn reduce<T: Reduce<U512, Bytes = WideBytes>>(slice: &[u8]) -> T {
    let mut bytes = WideBytes::default();
    bytes[(64 - slice.len())..].copy_from_slice(slice);
    T::reduce_bytes(&bytes)
}

pub fn sqrt(&self) -> CtOption<Self> {
    let w = &[
        0xc27ba528ab8b8547,
        0xffffe2d45c171e07,
        0xffffffffffffffff,
        0x1fffffff,
    ];
    let t = Self::from_u64(2).pow_vartime(w);
    let a1 = self.pow_vartime(w);
    let a0 = (a1.square() * self).square();
    let b = t * a1;
    let ab = self * &b;
    let i = Self::from_u64(2) * ab * b;
    let x = ab * (i - Self::ONE);
    CtOption::new(x, !a0.ct_eq(&-Self::ONE))
}

fn sub(self, other: &AffinePoint) -> ProjectivePoint {
    ProjectivePoint::sub_mixed(self, other)
}

fn square(&self) -> Self {
    self.square()
}

