fn fmt(&self, f: &mut fmt::Formatter<'_>) -> fmt::Result {
    write!(f, "Scalar(0x{:X})", &self.0)
}

fn from(p: AffinePoint) -> Self {
    let projective = ProjectivePoint {
        x: p.x,
        y: p.y,
        z: FieldElement::ONE,
    };
    Self::conditional_select(&projective, &Self::IDENTITY, p.is_identity())
}

pub fn sign_raw(&self, m: &[u8]) -> Result<InnerSignature, SigningError> {
    self.sign_inner(0, &[], m)
}

fn double(&self) -> Self {
    self.add(self)
}

fn try_sign(&self, msg: &[u8]) -> Result<Signature> {
    self.try_multipart_sign(&[msg])
}

fn invert_vartime(&self) -> CtOption<Self> {
    let mut u = *self;
    let mut v = Self(MODULUS);
    let mut A = Self::ONE;
    let mut C = Self::ZERO;

    while !bool::from(u.is_zero()) {
        // u-loop
        while bool::from(u.is_even()) {
            u >>= 1;

            let was_odd: bool = A.is_odd().into();
            A >>= 1;

            if was_odd {
                A += FRAC_MODULUS_2;
                A += Self::ONE;
            }
        }

        // v-loop
        while bool::from(v.is_even()) {
            v >>= 1;

            let was_odd: bool = C.is_odd().into();
            C >>= 1;

            if was_odd {
                C += FRAC_MODULUS_2;
                C += Self::ONE;
            }
        }

        // sub-step
        if u >= v {
            u -= &v;
            A -= &C;
        } else {
            v -= &u;
            C -= &A;
        }
    }

    CtOption::new(C, !self.is_zero())
}

fn try_from(public_key: PublicKey) -> Result<VerifyingKey> {
    if public_key.as_affine().y.normalize().is_even().into() {
        Ok(Self { inner: public_key })
    } else {
        Err(Error::new())
    }
}

