fn reduce_nonzero() {
    assert_eq!(
        U576::from(Scalar::reduce_nonzero_bytes(&Array::default())),
        U576::ONE,
    );
    assert_eq!(
        U576::from(Scalar::reduce_nonzero(U576::ONE)),
        U576::from_u8(2),
    );
    assert_eq!(
        U576::from(Scalar::reduce_nonzero(U576::from_u8(2))),
        U576::from_u8(3),
    );

    assert_eq!(
        U576::from(Scalar::reduce_nonzero(NistP521::ORDER)),
        U576::from_u8(2),
    );
    assert_eq!(
        U576::from(Scalar::reduce_nonzero(
            NistP521::ORDER.wrapping_sub(&U576::from_u8(1))
        )),
        U576::ONE,
    );
    assert_eq!(
        U576::from(Scalar::reduce_nonzero(
            NistP521::ORDER.wrapping_sub(&U576::from_u8(2))
        )),
        NistP521::ORDER.wrapping_sub(&U576::ONE),
    );
    assert_eq!(
        U576::from(Scalar::reduce_nonzero(
            NistP521::ORDER.wrapping_sub(&U576::from_u8(3))
        )),
        NistP521::ORDER.wrapping_sub(&U576::from_u8(2)),
    );

    assert_eq!(
        U576::from(Scalar::reduce_nonzero(
            NistP521::ORDER.wrapping_add(&U576::ONE)
        )),
        U576::from_u8(3),
    );
    assert_eq!(
        U576::from(Scalar::reduce_nonzero(
            NistP521::ORDER.wrapping_add(&U576::from_u8(2))
        )),
        U576::from_u8(4),
    );
}

fn add_result_within_256_bits() {
    // A regression for a bug where reduction was not applied
    // when the unreduced result of addition was in the range `[modulus, 2^256)`.
    let t = 1.to_biguint().unwrap() << 255;
    let one = 1.to_biguint().unwrap();

    let a = Scalar::from(&t - &one);
    let b = Scalar::from(&t);
    let res = a + b;

    let m = Scalar::modulus_as_biguint();
    let res_ref = Scalar::from((&t + &t - &one) % &m);

    assert_eq!(res, res_ref);
}

fn test_scalar_mul() {
    // XXX: In the future use known multiples from Sage in bytes form?
    let twisted_point = TWISTED_EDWARDS_BASE_POINT;
    let scalar = Scalar(U448::from_be_hex(
        "05ca185aee2e1b73def437f63c003777083f83043fe5bf1aab454c66b64629d1de8026c1307f665ead0b70151533427ce128ae786ee372b7",
    ));

    let got = variable_base(&twisted_point, &scalar);

    let got2 = double_and_add(&twisted_point, &scalar);
    assert_eq!(got, got2);

    // Lets see if this is conserved over the isogenies
    let edwards_point = twisted_point.to_untwisted();
