fn invert() {
    assert!(bool::from(FieldElement::ZERO.invert().is_none()));

    let one = FieldElement::ONE;
    assert_eq!(one.invert().unwrap().normalize(), one);

    let two = one + &one;
    let inv_two = two.invert().unwrap();
    assert_eq!((two * &inv_two).normalize(), one);
}

