fn conditional_select(a: &Self, b: &Self, choice: Choice) -> Self {
    let mut bytes = [0u8; 56];
    for (i, byte) in bytes.iter_mut().enumerate() {
        *byte = u8::conditional_select(&a.0[i], &b.0[i], choice);
    }
    Self(bytes)
}

