fn try_from(value: &[u8]) -> Result<Self, Self::Error> {
    let bytes =
        <PointBytes>::try_from(value).map_err(|_| "Invalid length, expected 57 bytes")?;
    Self::try_from(bytes)
}

pub fn encrypt_der<R: TryCryptoRng + ?Sized>(
    &self,
    rng: &mut R,
    msg: &[u8],
) -> Result<Vec<u8>> {
    self.encrypt_der_digest::<R, Sm3>(rng, msg)
}

fn decode_field_bytes(field_bytes: &Ed448FieldBytes) -> Self {
    U448::from_le_slice(field_bytes)
}

pub fn sqrt(&self) -> CtOption<Self> {
    // Because p  3 mod 4, sqrt can be done with only one
    // exponentiation via the computation of self^((p + 1) // 4) (mod p).
    let sqrt = self.pow_vartime(&[
        0xffffffffffffffd1,
        0xffffffffffffffff,
        0xffffffffffffffff,
        0x3fffffffffffffff,
    ]);
    CtOption::new(sqrt, (sqrt * sqrt).ct_eq(self))
}

pub fn sqrt(&self) -> FieldElement {
    const SQRT_EXP: U448 = U448::from_be_hex(
        "3fffffffffffffffffffffffffffffffffffffffffffffffffffffffc0000000000000000000000000000000000000000000000000000000",
    );
    Self(self.0.pow(&SQRT_EXP))
}

fn sub_assign(&mut self, rhs: &AffinePoint) {
    *self -= rhs.to_edwards();
}

fn from(scalar: Scalar) -> Self {
    scalar.to_bytes()
}

pub(super) const fn barrett_reduce(lo: U256, hi: U256) -> U256 {
    let lo = lo.as_limbs();
    let hi = hi.as_limbs();
    let a0 = lo[0];
    let a1 = lo[1];
    let a2 = lo[2];
    let a3 = lo[3];
    let a4 = hi[0];
    let a5 = hi[1];
    let a6 = hi[2];
    let a7 = hi[3];
    let q1 = [a3, a4, a5, a6, a7];
    let q3 = q1_times_mu_shift_five(&q1);

    let r1 = [a0, a1, a2, a3, a4];
    let r2 = q3_times_n_keep_five(&q3);
    let r = sub_inner_five(r1, r2);

    // Result is in range (0, 3*n - 1),
    // and 90% of the time, no subtraction will be needed.
    let r = subtract_n_if_necessary(r);
    U256::new([r[0], r[1], r[2], r[3]])
}

fn try_from(bytes: &[u8]) -> Result<Signature> {
    Signature::from_slice(bytes)
}

fn try_from_rng<R>(rng: &mut R) -> Result<Self, R::Error>
where
    R: TryRngCore + ?Sized,
{
    let mut uniform_bytes = [0u8; 112];
    rng.try_fill_bytes(&mut uniform_bytes)?;
    Ok(Self::from_uniform_bytes(&uniform_bytes))
}

fn from(p: NonIdentity<EdwardsPoint>) -> Self {
    p.to_point()
}

fn to_affine(&self) -> AffinePoint<C> {
    ProjectivePoint::to_affine(self)
}

fn neg(self) -> Scalar {
    Scalar::ZERO - self
}

fn fmt(&self, f: &mut Formatter<'_>) -> core::fmt::Result {
    let tmp = self.to_bytes_rfc_8032();
    for &b in tmp.iter() {
        write!(f, "{:02x}", b)?;
    }
    Ok(())
}

