pub fn bits(&self) -> [bool; 448] {
    let mut bits = [false; 448];
    let mut i = 0;
    // We have 56 limbs, each 8 bits
    // First we iterate each limb
    for limb in self.to_bytes().iter() {
        // Then we iterate each bit in the limb
        for j in 0..8 {
            bits[i] = limb & (1 << j) != 0;
            i += 1;
        }
    }

    // XXX :We are doing LSB first
    bits
}

