fn to_pkcs8_der(&self) -> pkcs8::Result<pkcs8::SecretDocument> {
    let verifying_key = self.verifying_key.as_ref();
    let public_key = verifying_key
        .map(|k| pkcs8::der::asn1::BitStringRef::from_bytes(k))
        .transpose()?;
    let private_key = pkcs8::der::asn1::OctetStringRef::new(self.secret_key.as_ref())?;

    let private_key_info = pkcs8::PrivateKeyInfoRef {
        algorithm: super::ALGORITHM_ID,
        private_key,
        public_key,
    };
    let result = pkcs8::SecretDocument::encode_msg(&private_key_info)?;

    Ok(result)
}

pub fn hash<X>(msg: &[u8], dst: &[u8]) -> Self
where
    X: ExpandMsg<U32>,
{
    type RandomLen = U84;
    let dst = [dst];
    let mut random_bytes = Array::<u8, RandomLen>::default();
    let mut expander = X::expand_message(
        &[msg],
        &dst,
        core::num::NonZero::new(RandomLen::U16 * 2)
            .expect("invariant violation: random is non zero length"),
    )
    .expect("bad dst");
    expander.fill_bytes(&mut random_bytes);
    let u0 = FieldElement::from_okm(&random_bytes);
    expander.fill_bytes(&mut random_bytes);
    let u1 = FieldElement::from_okm(&random_bytes);

    let q0 = u0.map_to_curve_decaf448();
    let q1 = u1.map_to_curve_decaf448();
    Self(q0.add(&q1))
}

