    let inv = a.invert().unwrap().normalize();
    let inv_bi = inv.to_biguint().unwrap();
    let m = FieldElement::modulus_as_biguint();
    assert_eq!((&inv_bi * &a_bi) % &m, 1.to_biguint().unwrap());
}

