fn add_then_sub(
    a0 in ANY,
    a1 in ANY,
    a2 in ANY,
    b0 in ANY,
    b1 in ANY,
    b2 in ANY,
) {
    let a = FieldElement(U256::from_words([a0, a1, a2, 0]));
    let b = FieldElement(U256::from_words([b0, b1, b2, 0]));
    assert_eq!(a.add(&b).sub(&a), b);
