pub const fn pow_vartime(&self, exp: &[u64]) -> Self {
    let mut res = Self::ONE;
    let mut i = exp.len();

    while i > 0 {
        i -= 1;

        let mut j = 64;
        while j > 0 {
            j -= 1;
            res = res.square();

            if ((exp[i] >> j) & 1) == 1 {
                res = Self::multiply(&res, self);
            }
        }
    }

    res
}

