pub fn encode<X>(msg: &[u8], dst: &[u8]) -> Self
where
    X: ExpandMsg<U28>,
{
    type RandomLen = U84;
    let mut random_bytes = Array::<u8, RandomLen>::default();
    let dst = [dst];
    let mut expander = X::expand_message(
        &[msg],
        &dst,
        core::num::NonZero::new(RandomLen::U16)
            .expect("invariant violation: random is non zero length"),
    )
    .expect("bad dst");
    expander.fill_bytes(&mut random_bytes);
    let u0 = FieldElement::from_okm(&random_bytes);
    let mut q0 = u0.map_to_curve_elligator2();
    q0 = q0.isogeny();

    q0.to_edwards().double().double()
}

pub(crate) fn hash_z(distid: &DistId, public_key: &impl AsRef<AffinePoint>) -> Result<Hash> {
    let entla: u16 = distid
        .len()
        .checked_mul(8)
        .and_then(|l| l.try_into().ok())
        .ok_or(Error)?;

    let mut sm3 = Sm3::new();
    sm3.update(entla.to_be_bytes());
    sm3.update(distid);
    sm3.update(Sm2::EQUATION_A.to_bytes());
    sm3.update(Sm2::EQUATION_B.to_bytes());
    sm3.update(Sm2::GENERATOR.0.to_bytes());
    sm3.update(Sm2::GENERATOR.1.to_bytes());

    match public_key.as_ref().to_encoded_point(false).coordinates() {
        sec1::Coordinates::Uncompressed { x, y } => {
            sm3.update(x);
            sm3.update(y);
            Ok(sm3.finalize())
        }
        _ => Err(Error),
    }
}

