pub fn to_extended(self) -> ExtendedPoint {
    let A = self.Y_plus_X - self.Y_minus_X;
    let B = self.Y_plus_X + self.Y_minus_X;
    ExtendedPoint {
        X: self.Z * A,
        Y: self.Z * B,
        Z: self.Z.square(),
        T: B * A,
    }
}

