pub fn double(&self) -> ExtensiblePoint {
    let A = self.X.square();
    let B = self.Y.square();
    let C = self.Z.square() + self.Z.square();
    let D = -A;
    let E = (self.X + self.Y).square() - A - B;
    let G = D + B;
    let F = G - C;
    let H = D - B;
    ExtensiblePoint {
        X: E * F,
        Y: G * H,
        Z: F * G,
        T1: E,
        T2: H,
    }
}

