pub(crate) fn to_affine(self) -> AffinePoint {
    // Points to consider:
    // - All points where Z=0, translate to (0,0)
    // - The identity point has z=1, so it is not a problem

    let INV_Z = self.Z.invert();

    let x = self.X * INV_Z;
    let y = self.Y * INV_Z;

    AffinePoint { x, y }
}

