}

pub(crate) fn double_and_add(point: &ExtendedPoint, s: &Scalar) -> ExtendedPoint {
    let mut result = ExtendedPoint::IDENTITY;

    // NB, we reverse here, so we are going from MSB to LSB
    // XXX: Would be great if subtle had a From<u32> for Choice. But maybe that is not it's purpose?
    for bit in s.bits().into_iter().rev() {
        result = result.double();

        let mut p = ExtendedPoint::IDENTITY;
        p.conditional_assign(point, Choice::from(bit as u8));
        result = result.add(&p);
    }

    result
}

const fn sub_inner_five(l: [Limb; 5], r: [Limb; 5]) -> [Limb; 5] {
    let (w0, borrow) = l[0].borrowing_sub(r[0], Limb::ZERO);
    let (w1, borrow) = l[1].borrowing_sub(r[1], borrow);
    let (w2, borrow) = l[2].borrowing_sub(r[2], borrow);
    let (w3, borrow) = l[3].borrowing_sub(r[3], borrow);
    let (w4, _borrow) = l[4].borrowing_sub(r[4], borrow);

    // If underflow occurred on the final limb - don't care (= add b^{k+1}).
    [w0, w1, w2, w3, w4]
}

