fn index(&self, index: usize) -> &Self::Output {
    &self.0[index]
}

fn conditional_select(a: &Self, b: &Self, choice: Choice) -> Self {
    ProjectiveNielsPoint {
        Y_plus_X: FieldElement::conditional_select(&a.Y_plus_X, &b.Y_plus_X, choice),
        Y_minus_X: FieldElement::conditional_select(&a.Y_minus_X, &b.Y_minus_X, choice),
        Td: FieldElement::conditional_select(&a.Td, &b.Td, choice),
        Z: FieldElement::conditional_select(&a.Z, &b.Z, choice),
    }
}

pub const fn add(&self, rhs: &Self) -> Self {
    Self(self.0.add_mod(&rhs.0, &NistP256::ORDER))
}

fn repeated_double() {
    let mut r = FieldElement::ONE;
    for item in DBL_TEST_VECTORS {
        assert_eq!(r.to_bytes().as_slice(), item);
        r = r.double();
    }
}

fn neg(self) -> Self::Output {
    Scalar::ZERO - self
}

pub fn is_odd(&self) -> Choice {
    self.0.is_odd()
}

fn mul(self, scalar: &Scalar) -> MontgomeryPoint {
    // Algorithm 8 of Costello-Smith 2017
    let affine_u = FieldElement::from_bytes(&self.0);
    let mut x0 = ProjectiveMontgomeryPoint::identity();
    let mut x1 = ProjectiveMontgomeryPoint {
        U: affine_u,
        W: FieldElement::ONE,
    };

    let bits = scalar.bits();
    let mut swap = 0;
    for s in (0..448).rev() {
        let bit = bits[s] as u8;
        let choice: u8 = swap ^ bit;

        ProjectiveMontgomeryPoint::conditional_swap(&mut x0, &mut x1, Choice::from(choice));
        differential_add_and_double(&mut x0, &mut x1, &affine_u);

        swap = bit;
    }

    x0.to_affine()
}

fn eq(&self, other: &Self) -> bool {
    self.ct_eq(other).into()
}

