fn edwards_isogeny(&self, a: FieldElement) -> EdwardsExtendedPoint {
    // Convert to affine now, then derive extended version later
    let affine = self.to_affine();
    let x = affine.x;
    let y = affine.y;

    // Compute x
    let xy = x * y;
    let x_numerator = xy + xy;
    let x_denom = y.square() - (a * x.square());
    let new_x = x_numerator * x_denom.invert();

    // Compute y
    let y_numerator = y.square() + (a * x.square());
    let y_denom = (FieldElement::ONE + FieldElement::ONE) - y.square() - (a * x.square());
    let new_y = y_numerator * y_denom.invert();

    EdwardsExtendedPoint {
        X: new_x,
        Y: new_y,
        Z: FieldElement::ONE,
        T: new_x * new_y,
    }
}

fn encode_pkcs8_private_key_to_pem() {
    let original_secret_key = sm2::SecretKey::from_pkcs8_der(&PKCS8_PRIVATE_KEY_DER[..]).unwrap();
    let reencoded_secret_key = original_secret_key
        .to_pkcs8_pem(Default::default())
        .unwrap();
    assert_eq!(reencoded_secret_key.as_str(), PKCS8_PRIVATE_KEY_PEM);
}

fn verify_prehash(&self, prehash: &[u8], signature: &Signature) -> Result<()> {
    // 1. If || != 3, return NO.
    if prehash.len() != <BignP256 as Curve>::FieldBytesSize::USIZE {
        return Err(Error::new());
    }
    // 2. Assume  as  = 0  1,  0  {0, 1}^, 1  {0, 1}^2.
    let s0 = signature.s0();
    // 3. If 1  , return NO.
    let s1 = signature.s1();

    let mut hash: Array<u8, U32> = Array::clone_from_slice(prehash);
    hash.reverse();

    let hw = Scalar::reduce_bytes(FieldBytes::from_slice(&hash));
    let left = s1.add(&hw);

    let right = s0.add(&Scalar::from_u64(2).pow([128, 0, 0, 0]));

    // 5. Set   ((1 + ) mod ) + (0 + 2).
    let r = ProjectivePoint::lincomb(&[
        (ProjectivePoint::generator(), left),
        (self.public_key.to_projective(), right),
    ]);

    // 6. If  = , return NO.
    if r.is_identity().into() {
        return Err(Error::new());
    }

    let mut r_bytes = r.to_bytes();
    r_bytes.reverse();

    let mut hasher = BeltHash::new();
    hasher.update(BELT_OID);
    hasher.update(&r_bytes[0..32]);
    hasher.update(prehash);

    // 7. Set   belt-hash(OID()  ^2  ) ^.
    let t = hasher.finalize();

    let s0 = &mut s0.to_bytes()[16..];
    s0.reverse();

    // 8. If 0 != , return NO.
    if s0 == &t.as_slice()[..16] {
        // 9. Return YES.
        Ok(())
    } else {
        Err(Error::new())
    }
}

