    out1[0] = 0x74ecb6e5a4954cc;
    out1[1] = 0x26a7844030955df6;
    out1[2] = 0xef16fedba3350f94;
    out1[3] = 0x4704d6d8;
}

pub(crate) fn equals(&self, other: &AffineNielsPoint) -> bool {
    (self.y_minus_x == other.y_minus_x)
        && (self.y_plus_x == other.y_plus_x)
        && (self.td == other.td)
}

fn to_bytes(&self) -> Self::Repr {
    let encoded = self.to_encoded_point(true);
    let mut result = CompressedPoint::<C>::default();
    result[..encoded.len()].copy_from_slice(encoded.as_bytes());
    result
}

pub(crate) const fn as_limbs(&self) -> &[u64; 9] {
    &self.0.0
}

fn mul(self, other: FieldElement) -> FieldElement {
    FieldElement(self.0.mul(&(other.0)))
}

fn from(signature: Signature) -> SignatureBytes {
    signature.to_bytes()
}

