pub(crate) fn inverse_square_root(&self) -> (FieldElement, Choice) {
    let (mut l0, mut l1, mut l2);

    l1 = self.square();
    l2 = l1 * self;
    l1 = l2.square();
    l2 = l1 * self;
    l1 = l2.square_n(3);
    l0 = l2 * l1;
    l1 = l0.square_n(3);
    l0 = l2 * l1;
    l2 = l0.square_n(9);
    l1 = l0 * l2;
    l0 = l1 * l1;
    l2 = l0 * self;
    l0 = l2.square_n(18);
    l2 = l1 * l0;
    l0 = l2.square_n(37);
    l1 = l2 * l0;
    l0 = l1.square_n(37);
    l1 = l2 * l0;
    l0 = l1.square_n(111);
    l2 = l1 * l0;
    l0 = l2.square();
    l1 = l0 * self;
    l0 = l1.square_n(223);
    l1 = l2 * l0;
    l2 = l1.square();
    l0 = l2 * self;

    let is_residue = l0.ct_eq(&FieldElement::ONE);
    (l1, is_residue)
}

